import React, { Component } from "react";
import "./counter.css";
import "./searchicon.png";
class Counter extends Component {
  render() {
    return (
      <div class="header">
        <h1>CINEPHILE</h1>{" "}
        <div id="button-holder">
          <img src="searchicon.png" />
        </div>
        <div class="searchbar">
          <input
            type="text"
            id="myInput"
            onkeyup="myFunction()"
            placeholder="Enter movie Name here"
          ></input>
        </div>
      </div>
    );
  }
}

export default Counter;
